import React, { Component } from 'react';
import Layout from '../../components/Layout';

class CampaignNew extends Component {
	render() {
		return (
			<Layout>
				<h1>New Campaign!!!</h1>
			</Layout>
		)
	}
}

export default CampaignNew;
